// Simplified ClusterMap component
import React, { useEffect } from 'react';
import { useValue } from '../../context/ContextProvider';
import { getGears } from '../../actions/gear';
import ReactMapGL from 'react-map-gl';

const ClusterMap = () => {
  const { state: { gears }, dispatch, mapRef } = useValue();

  useEffect(() => {
    getGears(dispatch);
  }, [dispatch]);

  return (
    <div style={{ height: '100vh', borderRadius: '10px', overflow: 'hidden' }}>
      <ReactMapGL
        width="100%"
        height="100%"
        initialViewState={{ latitude: 51.5072, longitude: 0.5555, zoom: 10 }}
        mapboxAccessToken={process.env.REACT_APP_MAP_TOKEN}
        mapStyle='mapbox://styles/mapbox/streets-v11'
        ref={mapRef}
      />
    </div>
  );
};

export default ClusterMap;
